import * as React from "react";
import Allocation from "./AllocationList";

class EmployeeList extends React.Component {
    render() {
        return (
			<div>
  	            {this.props.employees.map(employee => {
                    if (employee.projects.includes(this.props.projectTitle))
                    return <div>{employee.firstName} {employee.lastName}
                            <br/>{this.props.allocations.map(allocation => {
                                if (employee.projects.includes(this.props.projectTitle) && allocation.project == this.props.projectTitle)
                                return <Allocation projectTitle = {this.props.title} employees = {this.props.employees} allocations = {this.props.allocations}/>
                            }
                            )}
                            </div>
                  }
                )}
			</div>
			);
		}
	}

export default EmployeeList;
